import React, { Component } from 'react'

export class User_profile extends Component {

    constructor(props) {
        super(props);
        this.state = {profiles: []};
    }
    componentDidMount() {
        fetch('http://localhost/server/User_profile/get_all_user_profiles.php')
          .then(data => data.json())
          .then((data) => { this.setState({ profiles: data }) }); 
    }

    render() {
        console.log(profiles)
        return (
            <div>
                <h1>Profiles</h1>
            </div>
        )
    }
}

export default User_profile
